INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (1, "ヤマト", 130011, "2030/01/01 14:59:59", 2.1, 0.0, 100, "2024/10/31 12:00:00", "ミッションねえ……\nちょうどいいや\nどこまで片付けられるか\n賭けをしようじゃないか", -416.5, 2, 3001, 3001100);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (4, "ヤマト", 130011, "2030/01/01 14:59:59", 5.68, 0.0, 101, "2024/10/31 12:00:00", "他人から言われた任務を\n言われるままにやるなんざ\n性に合わないんだがね……\nま、報酬は貰っとこうか", -416.5, 2, 3001, 3001101);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (1, "ヤマト", 130011, "2030/01/01 14:59:59", 0.0, 0.0, 102, "2024/10/31 12:00:00", "なんだい？　やれンなら\nとっとと済ませちまいな。\nフブキが早くやることやれ\nってボヤいてたよ。", -416.5, 1, 3001, 3001102);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (1, "フブキ", 130211, "2030/01/01 14:59:59", 0.0, 0.0, 100, "2024/10/31 12:00:00", "え～？　ぼくに頼みごと～？\nどうしちゃおっかな～\nちゃんとお願いできたら\n考えてあげよっかな～？", -416.5, 1, 3002, 3002100);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (1, "フブキ", 130211, "2030/01/01 14:59:59", 0.0, 0.0, 101, "2024/10/31 12:00:00", "ほらほらぁ、これが\n欲しいんでしょ～？\nほんと、しょうがないよね～\nザコおに～いさん♡", -416.5, 1, 3002, 3002101);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (5, "フブキ", 130211, "2030/01/01 14:59:59", 8.53, 0.0, 102, "2024/10/31 12:00:00", "へえ～、欲しいんだ～？\nぼくのた・い・せ・つ・な・モ・ノ\nあははっ！　なに考えてんの？\nもうへんふしじゃ～んｗ", -416.5, 2, 3002, 3002102);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (7, "フブキ", 130211, "2030/01/01 14:59:59", 5.67, 0.0, 103, "2024/10/31 12:00:00", "なになに～？　もしかしてまた\nおねだりするつもりなんだ？\nとか言って、ほんとはぼくに\n会いたいだけだったりして～？", -416.5, 1, 3002, 3002103);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (1, "フブキ", 130211, "2030/01/01 14:59:59", 0.0, 0.0, 104, "2024/10/31 12:00:00", "ザコお兄さんってぇ\n頼み方もワンパなのぉ～？\nもっと必死にならないと\nぼくの心は動かせないよ～？", -416.5, 1, 3002, 3002104);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (3, "フブキ", 130211, "2030/01/01 14:59:59", 0.0, 0.0, 300, "2024/10/31 12:00:00", "あのさーザコお兄さん、\nな～んか調子乗ってない？\nぼくのこと、なんでもくれる\nチョロいやつとか思ってたりー？", -416.5, 3, 3004, 3002300);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (7, "フブキ", 130211, "2030/01/01 14:59:59", 0.0, 0.0, 301, "2024/10/31 12:00:00", "ざんね～ん♪\nうざいお兄さんには、もうな～んにもあげませ～ん♡\nほんとなっさけなーい♪\nばいば～い♡", -416.5, 7, 3005, 3002400);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (2, "フブキ", 130211, "2030/01/01 14:59:59", 4.4, 0.0, 200, "2024/10/31 12:00:00", "きゃはは、ほんと必死～♡\nは～、面白かった。\n笑えたからいいよ～\nそれ、恵んだげる～♪", -416.5, 1, 3003, 3003200);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (7, "フブキ", 130211, "2030/01/01 14:59:59", 0.0, 0.0, 201, "2024/10/31 12:00:00", "は～、しょうがないな～♡\nザコお兄さんってば\nほんとよわよわで\n情けないよね～ｗ", -416.5, 7, 3003, 3003201);
INSERT INTO `v1_78ec38428062a5aafded3f051c44d3e96c372b566843e908d87a4c72489d4d22` VALUES (1, "フブキ", 130211, "2030/01/01 14:59:59", 5.6, 0.0, 202, "2024/10/31 12:00:00", "お兄さんってば、ぼくがいないと\nほんとザッコザコだよね～\nもっと感謝しろし～♪", -416.5, 2, 3003, 3003202);
